import { Route,Routes,Router } from 'react-router-dom';
import './App.css';
import IndexPage from './pages/IndexPage';
import LoginPage from './pages/LoginPage';

function App() {
  return (
      <Routes>
      <Route index element={<IndexPage />} />
      <Route path="/login" element={<LoginPage/>}/>
    </Routes>

  );
}

export default App;
